VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'Overview Diabetes is a chronic, metabolic disease characterized by elevated levels of blood glucose (or blood sugar), which leads over time to serious damage to the heart, blood vessels, eyes, kidneys and nerves. The most common is type 2 diabetes, usually in adults, which occurs when the body becomes resistant to insulin or doesn''t make enough insulin. In the past 3 decades the prevalence of type 2 diabetes has risen dramatically in countries of all income levels. Type 1 diabetes, once known as juvenile diabetes or insulin-dependent diabetes, is a chronic condition in which the pancreas produces little or no insulin by itself. For people living with diabetes, access to affordable treatment, including insulin, is critical to their survival. There is a globally agreed target to halt the rise in diabetes and obesity by 2025.About 830 million people worldwide have diabetes, the majority living in low-and middle-income countries.', '{0.1578340083360672,-0.7944233417510986,-0.07621155679225922,0.621898889541626,0.20048104226589203,0.5271732807159424,0.7911593317985535,0.22198325395584106,0.6670696139335632,-0.03491213172674179,0.4294409155845642,0.24286147952079773,-0.7189385294914246,-0.5089605450630188,-0.5820485353469849,-0.16490639746189117,0.859899640083313,0.8567067980766296,-0.048564404249191284,0.1662411391735077,0.05522943288087845,-0.06675891578197479,-0.4691290855407715,-0.2966993451118469,-0.15474602580070496,-0.07147017121315002,-0.7696926593780518,-0.3014838993549347,-0.1482265293598175,0.1202702522277832,-0.3462201952934265,0.04019041359424591,0.5063422918319702,0.434163898229599,-0.5826925039291382,0.0014283837517723441,0.01585547812283039,0.9621453285217285,0.41723543405532837,-0.16450965404510498,0.285403847694397,0.3667173981666565,0.4570053219795227,-0.11345504224300385,-0.013233470730483532,0.30288979411125183,0.6232149600982666,0.4671381711959839,0.3416425883769989,0.2305395603