VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, '830 million people worldwide have diabetes, the majority living in low-and middle-income countries. More than half of people living with diabetes are not receiving treatment. Both the number of people with diabetes and the number of people with untreated diabetes have been steadily increasing over the past decades. Symptoms test Symptoms of type 1 diabetes include the need to urinate often, thirst, constant hunger, weight loss, vision changes and fatigue. These symptoms may occur suddenly. Symptoms for type 2 diabetes are generally similar to those of type 1 diabetes but are often less marked. As a result, the disease may be diagnosed several years after onset, after complications have already arisen. For this reason, it is important to be aware of risk factors. Prevention and treatment test Type 1 diabetes cannot currently be prevented.', '{0.18956126272678375,-0.8621517419815063,-0.11255280673503876,0.6009397506713867,0.020803887397050858,0.6126129031181335,0.8487304449081421,0.33095821738243103,0.9896662831306458,0.02667461335659027,0.39883679151535034,0.6213158965110779,-0.47655805945396423,-0.9058982729911804,-0.5156299471855164,-0.14622430503368378,0.854245662689209,0.8429083824157715,-0.13224580883979797,-0.22052182257175446,0.05410480499267578,-0.27245521545410156,-0.2212606817483902,-0.33296385407447815,-0.3495042324066162,0.07606122642755508,-0.5838663578033447,-0.24934022128582,0.04271692782640457,0.19217222929000854,-0.3012792766094208,-0.13930022716522217,0.5078073740005493,0.1480114459991455,-0.6172242164611816,0.08495514839887619,-0.23176085948944092,1.0861401557922363,0.5838767290115356,-0.27251580357551575,0.14007335901260376,0.4455854594707489,0.39984917640686035,-0.32706260681152344,-0.07799887657165527,0.3653867840766907,0.7611680030822754,0.3898339867591858,0.371008962392807,0.08086229860782623,0.003185506211593747,-0.250868558883667,0.7187491655349731,0.14466255903244019,-0