VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'Overview Cardiovascular diseases (CVDs) are the leading cause of death globally, taking an estimated 17.9 million lives each year. CVDs are a group of disorders of the heart and blood vessels and include coronary heart disease, cerebrovascular disease, rheumatic heart disease and other conditions. More than four out of five CVD deaths are due to heart attacks and strokes, and one third of these deaths occur prematurely in people under 70 years of age.The most important behavioural risk factors of heart disease and stroke are unhealthy diet, physical inactivity, tobacco use and harmful use of alcohol. Amongst environmental risk factors, air pollution is an important factor. The effects of behavioural risk factors may show up in individuals as raised blood pressure, raised blood glucose, raised blood lipids, and overweight and obesity.', '{0.4348776340484619,0.3714577555656433,-0.2728801667690277,0.041271697729825974,0.11408258229494095,0.5167025327682495,0.6692904233932495,-0.12190696597099304,-0.5563516616821289,-0.6257933378219604,0.36566412448883057,0.5899825692176819,-0.3353599011898041,-0.7769209146499634,-0.7276756167411804,0.33589527010917664,0.6737303733825684,0.48678115010261536,0.025631070137023926,0.14930476248264313,-0.2537601590156555,-0.0013253184733912349,-0.7588173151016235,-0.02095802314579487,-0.3406853675842285,0.19660595059394836,-0.3564355671405792,-0.501160740852356,-0.1797327697277069,-0.3896242380142212,0.057742148637771606,-0.509519636631012,0.3123907446861267,0.4916585385799408,-0.14763180911540985,-0.18280085921287537,0.21928836405277252,1.2738677263259888,0.248285174369812,-0.10058616101741791,-0.5669221878051758,-0.0315568745136261,0.6242955923080444,-0.4593401253223419,-0.16006645560264587,0.17662282288074493,0.05780449137091637,0.2837234437465668,0.4972912669181824,0.31783992052078247,-0.6244194507598877,-0.7423965334892273,-0.48241013288497925,0.2805159091949463,-0