VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, 'als as raised blood pressure, raised blood glucose, raised blood lipids, and overweight and obesity. These “intermediate risks factors” can be measured in primary care facilities and indicate an increased risk of heart attack, stroke, heart failure and other complications.Cessation of tobacco use, reduction of salt in the diet, eating more fruit and vegetables, regular physical activity and avoiding harmful use of alcohol have been shown to reduce the risk of cardiovascular disease. Health policies that create conducive environments for making healthy choices affordable and available, as well as improving air quality and reducing pollution, are essential for motivating people to adopt and sustain healthy behaviours.Identifying those at highest risk of CVDs and ensuring they receive appropriate treatment can prevent premature deaths.', '{0.46555182337760925,0.36990299820899963,-0.26414501667022705,-0.0036084356252104044,0.5355912446975708,0.7063349485397339,0.013515599071979523,0.04773591086268425,0.020740309730172157,-0.49660223722457886,0.1870151162147522,0.4843873083591461,-0.27403098344802856,-1.2249505519866943,-0.5619134306907654,0.3105045557022095,-0.00661488575860858,0.21779781579971313,-0.21526309847831726,-0.07834276556968689,-0.46070346236228943,-0.14873608946800232,-0.11576121300458908,-0.3403458893299103,-0.1780230551958084,0.229263573884964,-0.026661774143576622,-0.5534361600875854,0.12585704028606415,-0.3124052882194519,0.05253849923610687,-0.3680558502674103,0.1016942709684372,0.37383803725242615,-0.3494606912136078,-0.26017725467681885,0.04049559682607651,0.9122482538223267,0.12240076065063477,-0.4347308874130249,-0.5265595316886902,0.23956483602523804,0.4406435787677765,-0.24098308384418488,-0.46544453501701355,-0.09310583770275116,0.4298131465911865,0.19043859839439392,0.5617550611495972,0.3692907392978668,-0.6775937080383301,-0.2757820188999176,-0.5092403888702393,0.2296520918