VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 3, 'Women are more likely than men to have shortness of breath, nausea, vomiting, and back or jaw pain.The most common symptom of a stroke is sudden weakness of the face, arm, or leg, most often on one side of the body. Other symptoms include sudden onset of:numbness of the face, arm, or leg, especially on one side of the body;confusion, difficulty speaking or understanding speech;difficulty seeing with one or both eyes;difficulty walking, dizziness and/or loss of balance or coordination;severe headache with no known cause; and/orfainting or unconsciousness.People experiencing these symptoms should seek medical care immediately.Rheumatic heart diseaseSymptoms of rheumatic heart disease include: shortness of breath, fatigue, irregular heartbeats, chest pain and fainting. Symptoms of rheumatic fever (which can cause rheumatic heart disease if not treated) include: fever, pain and swelling of the joints, nausea, stomach cramps and vomiting.', '{0.273001492023468,-0.053214263170957565,0.4459407925605774,-0.49310165643692017,-0.05744434893131256,0.9563368558883667,0.5171443819999695,0.43040013313293457,-0.5170994400978088,-0.9610629677772522,0.2817227840423584,0.5963172912597656,-0.13529174029827118,-0.1364106386899948,0.21701981127262115,0.5350221991539001,0.7442474961280823,-0.009134642779827118,-0.013428290374577045,-0.49746713042259216,-0.8653597235679626,-0.051606684923172,-0.2934458255767822,-0.10126706957817078,0.2997358441352844,0.2855328619480133,-0.2614895701408386,-0.52458655834198,0.008826405741274357,0.35001295804977417,-0.45753034949302673,0.17883580923080444,-0.24214141070842743,1.0524927377700806,-0.3108260929584503,-0.3023487627506256,0.0003207649278920144,0.8846349716186523,-0.49740397930145264,-0.1461719572544098,0.1029006615281105,-0.24392999708652496,-0.39513862133026123,-0.48228150606155396,-0.029621364548802376,0.14004221558570862,0.1421787291765213,0.1842457503080368,-0.1752381473