VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 4, 'f not treated) include: fever, pain and swelling of the joints, nausea, stomach cramps and vomiting. Treatment WHO supports governments to prevent, manage and monitor CVDs by developing global strategies to reduce the incidence, morbidity and mortality of these diseases. These strategies include reducing risk factors, developing standards of care, enhancing health system capacity to care for patients with CVD, and monitoring disease patterns and trends to inform national and global actions.The risk factors for CVD include behaviours such as tobacco use, an unhealthy diet, harmful use of alcohol and inadequate physical activity. They also include physiological factors, including high blood pressure (hypertension), high blood cholesterol and high blood sugar or glucose, which are linked to underlying social determinants and drivers such as ageing, income and urbanization.', '{0.4030173420906067,0.33854761719703674,0.0516456700861454,-0.027590526267886162,0.6256970167160034,0.8613234162330627,0.4304455518722534,0.14644142985343933,-0.0998385027050972,-1.0015217065811157,0.1944880187511444,0.012356819584965706,-0.3496497571468353,-0.5874396562576294,-0.5121968388557434,0.6537641882896423,0.46419066190719604,-0.048051126301288605,0.2187967598438263,0.3193162679672241,-0.9508979916572571,-0.4614321291446686,-0.8307729959487915,-0.18196381628513336,-0.27514559030532837,-0.14645512402057648,-0.3749214708805084,-0.7446637153625488,-0.2245560735464096,-0.01368770096451044,0.3197551965713501,-0.1745351105928421,0.46658560633659363,0.3250960409641266,-0.2652882933616638,-0.16727150976657867,-0.27907001972198486,0.8057548403739929,-0.7273777723312378,-0.4801619052886963,-0.5217397809028625,0.27503156661987305,0.5917283892631531,-0.5677890181541443,-0.3930666148662567,-0.3496742248535156,0.5558863878250122,0.37918052077293396,0.3350779116153717,0.2136402577161789,-0.419186532497406,-0.5973538756370544,-0.3015