VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'Overview Cancer is a large group of diseases that can start in almost any organ or tissue of the body when abnormal cells grow uncontrollably, go beyond their usual boundaries to invade adjoining parts of the body and/or spread to other organs. The latter process is called metastasizing and is a major cause of death from cancer. A neoplasm and malignant tumour are other common names for cancer.Cancer is the second leading cause of death globally, accounting for an estimated 9.6 million deaths, or 1 in 6 deaths, in 2018. Lung, prostate, colorectal, stomach and liver cancer are the most common types of cancer in men, while breast, colorectal, lung, cervical and thyroid cancer are the most common among women.The cancer burden continues to grow globally, exerting tremendous physical, emotional and financial strain on individuals, families, communities and health systems.', '{-0.2213946431875229,-0.31031787395477295,-0.12123998254537582,0.273322194814682,0.450550377368927,0.24975474178791046,-0.030168671160936356,-0.18960818648338318,-0.8635555505752563,0.08661943674087524,-0.15392588078975677,0.6805013418197632,-0.12340258806943893,-0.5699215531349182,-0.291660338640213,-0.43028882145881653,0.652809202671051,0.7345401644706726,0.5227811336517334,-0.4399316608905792,-0.11827424168586731,0.19669486582279205,-0.9496756196022034,0.047872040420770645,-0.3738241493701935,-0.0368746742606163,-0.8459517359733582,-0.10989246517419815,-0.6710197329521179,-0.4845632314682007,-0.9422888159751892,-0.45704445242881775,0.9913452863693237,0.023603253066539764,-0.38754746317863464,0.3840070366859436,0.40912488102912903,0.7405036687850952,-0.8091146349906921,-0.20313973724842072,0.8436898589134216,-0.2440778762102127,-0.20364178717136383,-0.35952961444854736,0.3505959212779999,-0.42857974767684937,0.7246827483177185,-0.8029706478118896,0.601444661617279,-0.11301442980766296,-0.10229071229696274,-0.2735714614391327,-0