VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'Overview Nutrition is a critical part of health and development. Better nutrition is related to improved infant, child and maternal health, stronger immune systems, safer pregnancy and childbirth, lower risk of non-communicable diseases (such as diabetes and cardiovascular disease), and longevity.Healthy children learn better. People with adequate nutrition are more productive and can create opportunities to gradually break the cycles of poverty and hunger.Malnutrition, in every form, presents significant threats to human health. Today the world faces a double burden of malnutrition that includes both undernutrition and overweight, especially in low- and middle-income countries. There are multiple forms of malnutrition, including undernutrition (wasting or stunting), inadequate vitamins or minerals, overweight, obesity, and resulting diet-related noncommunicable diseases.', '{0.2701661288738251,-0.6876974105834961,0.3656642735004425,-0.24347476661205292,0.34802481532096863,0.8302796483039856,-0.2540147304534912,0.09370965510606766,-0.06734360009431839,0.3148139417171478,0.34740716218948364,0.2352687120437622,-0.6389095783233643,-0.006688510067760944,-0.7693709135055542,0.045509226620197296,0.004269755911082029,0.34110337495803833,-0.43162354826927185,-0.09503111243247986,-0.5500432848930359,0.40086397528648376,-0.6295927166938782,-0.2550562918186188,-0.0802207812666893,0.04192931950092316,-0.6348987817764282,-0.7626164555549622,0.8546887040138245,0.6686962842941284,-0.7029036283493042,0.33868300914764404,-0.036390140652656555,-0.10055797547101974,-0.5603001117706299,-0.27900388836860657,0.10744525492191315,0.4992590546607971,0.4514836072921753,0.31774255633354187,-0.42277947068214417,-0.31017184257507324,-0.30724960565567017,0.3205699920654297,-0.4345458149909973,0.28394025564193726,0.4601840376853943,-0.21426601707935333,-0.1513652503490448,-0.19439509510993958,-0.02816665545105934,0.2982100844