VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 'a serious global public health problem that particularly affects young children and pregnant women. WHO estimates that 40% of children less than 5 years of age and 37% of pregnant women worldwide are anaemic. Thirty percent of women of reproductive age have anaemia.Globally, 1.9 billion adults are overweight or obese and 38.9 million children under 5 years of age are overweight. Rates of childhood overweight and obesity are rising, particularly in high-income and upper-middle-income countries.Although breastfeeding protects against undernutrition and overweight, only 44% of infants under 6 months of age are exclusively breastfed.High sodium consumption (>5 g salt/day) contributes to high blood pressure and increases the risk of heart disease and stroke. Most people consume too much salt – on average 9–12 grams per day, or around twice the recommended maximum level of intake.', '{0.011362146586179733,-0.39579829573631287,-0.3577897846698761,0.2875690758228302,0.06854566931724548,0.9032217264175415,-0.061130594462156296,0.1495012491941452,-0.12529011070728302,-0.506130576133728,0.3002236783504486,0.6026431322097778,-0.6381218433380127,-0.3133719563484192,-0.3319239616394043,-0.08761922270059586,0.5356643795967102,0.9554896950721741,-0.5320966243743896,-0.27654507756233215,-0.6813167929649353,0.07014134526252747,-0.6401597857475281,-0.1311204582452774,0.5249879360198975,-0.38733747601509094,-0.24962030351161957,-0.8131661415100098,-0.3258085250854492,0.28759893774986267,-0.549336314201355,-0.5431445837020874,0.19606828689575195,0.027806932106614113,-0.47570568323135376,0.21261350810527802,0.18360678851604462,0.6906265616416931,0.0563775971531868,-0.23395361006259918,-0.7935776710510254,-0.04287471994757652,-0.04027839004993439,0.0077354796230793,-0.3430347144603729,0.13009600341320038,0.34532639384269714,0.11317405849695206,0.7236812710762024,0.5111560225486755,-0.4803673326969147,0.077337294816970