VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'Overview Regular physical activity is proven to help prevent and manage noncommunicable diseases (NCDs) such as heart disease, hypertension, stroke, diabetes and several cancers. It also helps to maintain a healthy body weight and can improve mental health, quality of life and well-being. Physical activity refers to all movement. Popular ways to be active include walking, cycling, wheeling, sports, active recreation and play, and can be done at any level of skill and for enjoyment by everybody. Work such as household chores or jobs requiring physical labour is another way to be physically active. Yet, current global estimates show 1 in 3 adults and 81% of adolescents do not do enough physical activity. Furthermore, as countries develop economically, levels of inactivity increase and can be as high as 70% due to changing transport patterns, increased use of technology for work and recreation, cultural values and increasing sedentary behaviour.', '{0.4439387917518616,0.10835987329483032,-0.3881068229675293,0.5379102826118469,0.04250640049576759,0.5848344564437866,-1.0275843143463135,0.6396637558937073,-0.2905750274658203,-0.6619148254394531,0.046463385224342346,0.2087961733341217,0.2401479035615921,-0.459211140871048,-0.46485573053359985,-0.1449788212776184,0.052526071667671204,0.3202351927757263,-0.384197860956192,0.10574116557836533,-0.9363449215888977,0.20186296105384827,-0.5657795667648315,-0.38096290826797485,0.36054447293281555,0.8864927291870117,0.19734469056129456,-0.7644036412239075,0.9320818185806274,0.3209315538406372,0.30089133977890015,0.1711530089378357,0.7418469190597534,0.2090439796447754,-0.2216995507478714,-0.09226036071777344,0.3088643550872803,0.8779487609863281,0.1646232008934021,0.04700247943401337,0.10988929122686386,0.576819121837616,-0.27811166644096375,-0.11285220831632614,-0.6680664420127869,0.6648433208465576,0.01390205230563879,-0.1898525059223175,-0.0851399153470993,0