VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, 'eased use of technology for work and recreation, cultural values and increasing sedentary behaviour.Sedentary behaviour is periods of low energy expenditure such as sitting and watching TV. Both sedentary behaviour and inadequate levels of physical activity have negative impacts on health systems, the environment, economic development, community and individual well-being and quality of life. Impact Physical inactivity is one of the leading risk factors for noncommunicable diseases (NCDs) and death worldwide.  Alternately, regular physical activity reduces risk of many types of cancer by 8–28%; heart disease and stroke by 19%; diabetes by 17%, depression and dementia by 28–32%.  It is estimated that 4–5 million deaths per year could be averted if the global population was more active.One in 4 adults and 4 in 5 adolescents don’t do enough physical activity. Women and girls generally are less active than men and boys, widening health inequalities.', '{0.6009750366210938,0.2661423683166504,-0.10402185469865799,0.63627028465271,0.21086040139198303,0.5596374273300171,-1.0874403715133667,0.5226696729660034,-0.15253153443336487,-0.696386456489563,0.25049546360969543,0.3494161367416382,-0.14406561851501465,-0.4594571590423584,-0.40473130345344543,-0.26694342494010925,0.14770571887493134,0.25966498255729675,-0.3318101465702057,0.0658809021115303,-0.8638044595718384,0.31272557377815247,-0.7822469472885132,-0.4982947111129761,0.13025839626789093,0.8344603180885315,0.2419401854276657,-0.5975451469421387,0.8806955218315125,0.2974086105823517,0.27719244360923767,0.06287175416946411,0.701888382434845,0.305632621049881,-0.41831737756729126,0.09495574235916138,0.4175126850605011,0.8088259100914001,-0.048499058932065964,0.18525800108909607,0.07617892324924469,0.2506415843963623,-0.18157489597797394,-0.07561614364385605,-0.6763395071029663,0.6896314024925232,0.1110059916973114,-0.2851165235042572,0.0720201358199119