VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 'activity. Women and girls generally are less active than men and boys, widening health inequalities. Older adults and people living with disabilities are also less likely to be active and miss out on the physical, mental and social health benefits. Physical inactivity burdens society through the hidden and growing cost of medical care and loss of productivity.WHO developed an economic analysis which predicts that nearly 500 million new cases of preventable major NCDs will occur globally between 2020 and  2030 if the prevalence of physical inactivity does not change. These NCDs will cost an estimated US $300 billion in healthcare costs alone in that 11 year period, or about US$ 27 billion per year. These estimates do not include the significant indirect costs including loss of productivity. Failing to increase levels of physical activity will negatively impact attainment of global targets as well as multiple SDGs.', '{0.5221303701400757,0.03152675926685333,0.015990255400538445,0.6216620206832886,0.09323668479919434,0.9318941235542297,-0.8763980865478516,0.8660144805908203,-0.0012839551782235503,-0.6458077430725098,0.04601651057600975,-0.12888438999652863,-0.3686768412590027,0.00013321422738954425,-0.41492435336112976,0.28143635392189026,0.25213587284088135,0.2023540586233139,-0.15606454014778137,0.14911164343357086,-0.834969699382782,0.16094037890434265,-0.9677857756614685,-0.5350390672683716,-0.17960257828235626,0.5599414706230164,-0.05263267830014229,-0.8324077725410461,0.6413480043411255,0.6045518517494202,0.3315800130367279,0.06801348179578781,0.7349452972412109,-0.16365329921245575,-0.54776531457901,0.2218613177537918,0.3728947639465332,0.8514355421066284,0.29393622279167175,0.43768659234046936,0.0019235223298892379,0.697705864906311,0.09320594370365143,-0.5193223357200623,-0.4827505946159363,0.919844925403595,0.323140025138855,0.16522759199142456,0.0794726237654686,0.3049984574317932,-0.839