VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'Overview Hypertension, also known as high or raised blood pressure, is a condition in which the blood vessels have persistently raised pressure. Blood is carried from the heart to all parts of the body in the vessels. Each time the heart beats, it pumps blood into the vessels. Blood pressure is created by the force of blood pushing against the walls of blood vessels (arteries) as it is pumped by the heart. The higher the pressure, the harder the heart has to pump. Hypertension is a serious medical condition and can increase the risk of heart, brain, kidney and other diseases. It is a major cause of premature death worldwide, with upwards of 1 in 4 men and 1 in 5 women – over a billion people ­– having the condition. The burden of hypertension is felt disproportionately in low- and middle-income countries, where two thirds of cases are found, largely due to increased risk factors in those populations in recent decades.', '{0.7368576526641846,-0.1920648068189621,-0.0019218896050006151,-0.045486241579055786,0.0978379100561142,0.19776609539985657,0.40068456530570984,0.27024826407432556,0.15774163603782654,-1.1362709999084473,0.4928654134273529,-0.0975494459271431,-0.2981410324573517,-0.6948789358139038,-0.9906166791915894,0.74167400598526,1.0734927654266357,0.4209548830986023,-0.601635754108429,0.0063535417430102825,-0.6962811350822449,-0.09235581010580063,-0.44280165433883667,0.16119907796382904,0.48927420377731323,-0.529812216758728,0.06991525739431381,-0.8147455453872681,-0.8712685108184814,0.3410812020301819,-0.5281829833984375,-1.1474977731704712,0.3867928385734558,0.3550441563129425,-0.31488749384880066,0.28404268622398376,0.14160288870334625,1.9544068574905396,-0.009358776733279228,0.0015102674951776862,-0.3959118127822876,-0.47102928161621094,0.19892509281635284,-0.42067012190818787,0.073857381939888,-0.22218482196331024,-0.184438556432724,0.15291906893253326,0.3748716413974762,0.58365327119