VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, 'ds of cases are found, largely due to increased risk factors in those populations in recent decades. Symptoms Many people with hypertension do not notice symptoms and may be unaware there is a problem. Symptoms can include early morning headaches, nosebleeds, irregular heart rhythms, vision changes, and buzzing in the ears. More severe forms may exhibit fatigue, nausea, vomiting, confusion, anxiety, chest pain, and muscle tremors. If left untreated, hypertension can cause persistent chest pain (also called angina), heart attacks, heart failure, and an irregular heartbeat, which can lead to a sudden death.  Hypertension can also cause strokes by blocking or bursting arteries that supply blood and oxygen to the brain, as well as kidney damage, which can lead to kidney failure. High blood pressure causes damage to the heart by hardening arteries and decreasing the flood of blood and oxygen to the heart. Detecting hypertension is done with a quick and painless test of blood pressure.', '{0.6542472243309021,0.013749904930591583,0.23062856495380402,-0.23308297991752625,-0.13849107921123505,0.3486366271972656,0.25026363134384155,0.2881486415863037,0.5864178538322449,-1.1880909204483032,0.4365215003490448,0.651389479637146,-0.328935831785202,-0.9753502011299133,-1.052767276763916,0.6994414329528809,0.8646901845932007,0.3007456064224243,-0.37217170000076294,-0.2583702504634857,-1.0432549715042114,-0.3815702199935913,-0.3461639881134033,-0.1412941813468933,0.11787230521440506,-0.32866448163986206,-0.2007240504026413,-0.7830824851989746,-0.6575930714607239,0.365256667137146,-0.6876582503318787,-1.0361745357513428,0.23872768878936768,0.4229946434497833,0.0022468362003564835,0.057386308908462524,-0.1850358098745346,1.6405609846115112,0.20146727561950684,-0.054458241909742355,-0.3677175045013428,-0.10168050229549408,-0.08163073658943176,-0.46581903100013733,-0.05047909915447235,0.13690155744552612,-0.13283677