VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 'xygen to the heart. Detecting hypertension is done with a quick and painless test of blood pressure. This can be done at home, but a health professional can help assess any risks or associated conditions. Treatment Reducing modifiable risk factors is the best way to prevent hypertension and associated diseases of the heart, brain, kidney and other organs. These factors include unhealthy diets (excessive salt consumption, a diet high in saturated fat and trans fats, low intake of fruits and vegetables), physical inactivity, consumption of tobacco and alcohol, and being overweight or obese. Additionally, prolonged exposure to air pollution increases the risk of hypertension in adults.  There are also non-modifiable risk factors, including a family history of hypertension, age over 65 years and co-existing diseases such as diabetes or kidney disease. Avoiding dietary and behavioural risk factors is doubly important for those with unmodifiable or hereditary risk factors.', '{0.4799296259880066,0.18477283418178558,0.022646507248282433,0.17332272231578827,0.052046433091163635,0.45071178674697876,0.11455635726451874,0.1797517091035843,0.22510264813899994,-0.6949028372764587,0.47901514172554016,0.6154825687408447,-0.34555917978286743,-1.1916214227676392,-1.0707794427871704,0.4287911355495453,0.41937169432640076,0.31477317214012146,-0.3051663339138031,-0.3727220296859741,-0.7731702923774719,-0.5309680700302124,-0.3874751031398773,-0.1286221146583557,0.23683618009090424,-0.46213915944099426,-0.15297169983386993,-0.7347474098205566,-0.4805199205875397,0.16442076861858368,-0.3509065508842468,-0.9179497361183167,0.4201697111129761,0.31768718361854553,-0.23377488553524017,0.2445390522480011,-0.043795257806777954,1.799355149269104,0.05636287108063698,-0.06307236850261688,-1.022620439529419,-0.1038927435874939,0.17961572110652924,-0.737457275390625,-0.41005009412765503,-0.0700106993317604,0.1402677297592163,-0.