VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'Overview Overweight and obesity are defined as abnormal or excessive fat accumulation that presents a risk to health. A body mass index (BMI) over 25 is considered overweight, and over 30 is obese. In 2019, an estimated 5 million noncommunicable disease (NCD) deaths were caused by higher-than-optimal BMI. Rates of overweight and obesity continue to grow in adults and children. From 1990 to 2022, the percentage of children and adolescents aged 5–19 years living with obesity increased four-fold from 2% to 8% globally, while the percentage of adults 18 years of age and older living with obesity more than doubled from 7% to 16%.Obesity is one side of the double burden of malnutrition, and today more people are obese than underweight in every region except the South-East Asia Region. Once considered a problem only in high-income countries, today some middle-income countries have among the highest prevalence of overweight and obesity worldwide.', '{0.9187319874763489,-0.46414342522621155,-0.08352582156658173,0.2689605951309204,0.3440040349960327,0.5685766935348511,0.029711652547121048,-0.19544769823551178,-0.009330446831882,0.11869052797555923,0.39235907793045044,-0.3381282687187195,-0.20889626443386078,0.20494043827056885,-1.1583014726638794,-0.12273557484149933,0.47259119153022766,0.7260783314704895,-0.8039843440055847,0.2999662756919861,-0.49909886717796326,-0.011612704023718834,-0.8751842975616455,0.0021030697971582413,0.3256496489048004,0.3193136751651764,-0.28895750641822815,-0.5610141754150391,0.0512915700674057,0.2138274610042572,-0.5978065729141235,-0.2500675916671753,0.13991278409957886,-0.11841383576393127,-0.3811275064945221,0.2942444384098053,0.4559469521045685,0.7720248103141785,0.5155453085899353,-0.37332597374916077,-0.17834249138832092,0.42265695333480835,0.3806055784225464,-0.26770883798599243,-0.3204655349254608,0.5228695869445801,-0.36896440386772156,-0.05186820775270462,0.79543197