VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, 'some middle-income countries have among the highest prevalence of overweight and obesity worldwide. Complications Overweight and obesity are major risk factors for a number of chronic diseases, including cardiovascular diseases such as heart disease and stroke, which are the leading causes of death worldwide. Being overweight can also lead to diabetes and its associated conditions, including blindness, limb amputations, and the need for dialysis. Rates of diabetes have quadrupled since around the world since 1980. Carrying excess weight can lead to musculoskeletal disorders including osteoarthritis. Obesity is also associated with some cancers, including endometrial, breast, ovarian, prostate, liver, gallbladder, kidney and colon. The risk of these noncommunicable diseases increases even when a person is only slightly overweight and grows more serious as the body mass index (BMI) climbs.', '{0.7740062475204468,-0.6399211883544922,-0.12736526131629944,0.2731615900993347,0.608208954334259,0.37657108902931213,0.18819867074489594,0.11094996333122253,0.02296585775911808,0.2740520238876343,0.5093286633491516,0.01816161349415779,-0.06951551884412766,-0.14040794968605042,-1.214443564414978,0.07386472821235657,0.040300432592630386,0.5241358876228333,-0.3710162043571472,-0.3068271279335022,-0.3401627540588379,0.1326935589313507,-0.7728293538093567,0.1309458464384079,-0.036281801760196686,0.3773065209388733,-0.1732737272977829,-0.6450737714767456,0.08873064070940018,0.17002208530902863,-0.571725070476532,-0.3570941388607025,0.32490304112434387,0.03443374112248421,-0.00143233104608953,0.3440198004245758,0.3234739601612091,0.8920289874076843,0.6369142532348633,-0.4711500406265259,-0.19082409143447876,0.14236201345920563,0.3768351674079895,-0.4970305860042572,-0.46056973934173584,0.25291943550109863,0.11248596757650375,-0.4177747070789337,0.7694787979125977,0.009173883125185966,-0.9054003357887268,-0.16998799