VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'Overview Epilepsy is the most common chronic brain disease and affects people of all ages. More than 50 million people worldwide have epilepsy; nearly 80% of them live in low- and middle-income countries.An estimated 70% of people with epilepsy could be seizure free if properly diagnosed and treated. However, about three quarters of people with epilepsy in low-income countries do not get the treatment they need, and this rises to 90% in some countries. In many such countries, many health professionals do not have the training to recognize, diagnose and treat epilepsy. In most resource-poor countries, antiseizure medicines are not available.People with epilepsy and their families frequently suffer from stigma and discrimination. In many parts of the world the true nature of epilepsy has also long been distorted by myths, fear and mistaken notions about the disorder.WHO is working with ministries of health and partners to improve access to treatment for epilepsy.', '{0.2736912667751312,-0.14176250994205475,0.7325394749641418,-0.4963950216770172,-0.22935380041599274,0.28388670086860657,0.08087991178035736,-0.8065094351768494,-0.6066420674324036,-0.09048964083194733,0.2596607208251953,0.8287559747695923,0.4411511719226837,0.8415001034736633,-0.488183856010437,0.5777319073677063,0.2051173895597458,0.3231281340122223,-0.33306822180747986,-0.13617026805877686,-1.0588505268096924,0.2936578691005707,-0.7796391248703003,-0.5230834484100342,0.2581303119659424,0.08282719552516937,-0.07093089818954468,-0.49244949221611023,-0.3052361309528351,0.07833542674779892,-0.9380859732627869,-0.14881740510463715,-0.038319025188684464,0.5274784564971924,-0.7998276948928833,-0.19668790698051453,-0.45051270723342896,-0.003497360274195671,0.3439858853816986,-0.18061593174934387,-0.36943620443344116,0.42409950494766235,-0.31314224004745483,-0.30112922191619873,0.4892826974391937,-0.13965457677841187,-0.23848401010036469,-0.