VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 3, 'ry care, non-specialist health care providers to diagnose, treat and follow up people with epilepsy. The WHO Programme on Reducing the Epilepsy Treatment Gap combined several innovative strategies to support access and care to services for people with epilepsy, thereby reducing the epilepsy treatment gap. The Programme was implemented in four countries – Ghana, Mozambique, Myanmar and Viet Nam.WHO published Improving the lives of people with epilepsy: a technical brief, which sets out the actions required to deliver an integrated approach to epilepsy care and treatment. This better meets the multifaceted needs of people with epilepsy. Fact sheets EpilepsyMental disordersDatabases and tools ATLAS Country Resources for Neurological Disorders Second EditionResolutions and decisions Resolution WHA 68.20: Global burden of epilepsy and the need for coordinated action at the country level to address its health, social and public knowledge implicationsA75/10 Add.', '{0.003382366616278887,-0.2894885540008545,0.6059489846229553,-0.47653064131736755,-0.4002540707588196,0.45752254128456116,-0.007588811218738556,-0.7375726699829102,-0.26222702860832214,-0.4524964690208435,-0.16745087504386902,0.3559769093990326,0.15556609630584717,0.7872183918952942,-0.29258593916893005,0.7046678066253662,-0.15201757848262787,0.1277785748243332,-0.2191401869058609,0.10667042434215546,-0.990602970123291,-0.15539118647575378,-0.9639462828636169,-0.6897212266921997,0.38267552852630615,-0.028592916205525398,0.10922620445489883,-0.3596203029155731,-0.3826671540737152,0.31662434339523315,-0.4852045476436615,-0.0644434466958046,-0.28470808267593384,0.4778660535812378,-0.5683197975158691,-0.2705606520175934,-0.19510792195796967,-0.06836426258087158,0.23768018186092377,0.02533089742064476,-0.030361536890268326,0.7368942499160767,-0.4748650789260864,-0.3413008749485016,0.35898852348327637,-0.19758723676204681,-0.3247930407524109,0.094