VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'High blood pressure High blood pressure (also called hypertension) can lead to serious problems like heart attacks or strokes. But lifestyle changes and blood pressure medicines can help you stay healthy. Check if you''re at risk of high blood pressure High blood pressure is very common, especially in older adults. There are usually no symptoms, so you may not realise you have it.Things that increase your chances of having high blood pressure include:your age – you''re more likely to get high blood pressure as you get olderhaving close relatives with high blood pressureyour ethnicity – you''re at higher risk if you have a Black African, Black Caribbean or South Asian ethnic backgroundhaving an unhealthy diet – especially a diet that''s high in saltbeing overweightsmokingdrinking too much alcoholfeeling stressed over a long period Non-urgent advice: Get your blood pressure checked at a pharmacy or GP surgery if: you think you might have high blood pressure or might be at risk of having high', '{0.6102018356323242,-0.2806594669818878,-0.28734198212623596,-0.21651777625083923,0.14594745635986328,0.518557608127594,-0.09161235392093658,0.3023972809314728,0.6409944891929626,-0.7295635938644409,0.2710520625114441,0.05713026225566864,-0.25323379039764404,-0.9648351669311523,-0.8896662592887878,0.43522799015045166,0.34851863980293274,0.5733636617660522,-0.6442077159881592,-0.06955251842737198,-0.858449399471283,-0.41826897859573364,-0.3802735209465027,0.0784519612789154,0.3440243601799011,-0.5853862166404724,0.3977809250354767,-1.1860971450805664,-0.5475805997848511,0.37277811765670776,-0.658629298210144,-0.7975285053253174,0.2729288935661316,0.4499969482421875,0.126679465174675,0.2769002616405487,-0.05896572023630142,1.5681060552597046,0.4177839159965515,-0.2776268720626831,-0.6933981776237488,0.30619582533836365,0.0873221680521965,-0.6403636336326599,-0.1979725956916809,-0.2427644431591034,-0.146760493