VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 'nBut the only way to find out if you have high blood pressure is to get your blood pressure checked. Urgent advice: Get help from NHS 111 if: you often have headaches or blurred visionyou have chest pain that comes and goesyou have other symptoms you''re worried could be caused by high blood pressureYou can call 111 or get help from 111 online. Immediate action required: Call 999 if: you get sudden pain or discomfort in your chest that does not go away – the pain can feel like squeezing or pressure inside your chest, burning or indigestionyou get pain that spreads to your left or right arm, or your neck, jaw, stomach or backyou have chest pain and you feel sweaty, sick, light headed or short of breathYou could be having a heart attack. Call 999 straight away as you need immediate treatment in hospital. Information: Do not drive yourself to A&E. The person you speak to at 999 will give you advice about what to do.', '{-0.2057623565196991,-0.23710352182388306,0.06297938525676727,-0.6982374787330627,-0.5031946301460266,0.8834262490272522,-0.2727486491203308,-0.24316884577274323,-0.14488306641578674,-0.636468768119812,0.4290488362312317,0.7209463715553284,-0.43284666538238525,-0.8510165810585022,-0.34841063618659973,0.22872158885002136,0.2723797559738159,0.33350470662117004,-0.5674582123756409,0.32362785935401917,-0.6218011975288391,-0.4397801160812378,-0.46313270926475525,-0.21083477139472961,0.9903084635734558,-0.3634987771511078,-0.038222894072532654,-1.0940217971801758,-0.2649576961994171,0.518680989742279,-0.7292129993438721,-0.7783747315406799,0.07266243547201157,0.6143377423286438,-0.21286138892173767,-0.00908951461315155,-0.29432690143585205,0.9042056202888489,-0.11757910996675491,-0.2183089703321457,-0.5167237520217896,0.4403088092803955,-0.7078195810317993,-0.1718015968799591,-0.46019136905670166,-0.397970974445343,-0.09813028573989868,0.1572161763906479,0.8981997966766357,0.24979680776596