VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 3, 'Do not drive yourself to A&E. The person you speak to at 999 will give you advice about what to do. What happens at a blood pressure check A blood pressure test involves inflating a band (cuff) around your upper arm and measuring the pressure in your blood vessels.If the test shows you might have high blood pressure, you may be asked to:use a blood pressure monitor at home to check your blood pressure regularly over the next few dayscome back to your GP surgery a few days or weeks later to have your blood pressure checked againwear a portable monitor that takes regular readings over 24 hoursThis can confirm if you have high blood pressure.What your blood pressure reading meansBlood pressure readings are given as 2 numbers, with the 1st number higher than the 2nd (for example, 130/80).', '{0.4184693694114685,-0.16671806573867798,-0.4581904709339142,-0.3577289283275604,-0.587803065776825,0.00927752535790205,-0.1287984400987625,-0.0863589495420456,0.30094143748283386,-0.396925687789917,0.36741629242897034,0.10672305524349213,-0.2862227261066437,-0.8958744406700134,-0.8621914982795715,0.4267299175262451,0.21664583683013916,0.1889609843492508,-0.641613781452179,0.46845635771751404,-0.8538756966590881,-0.8415801525115967,-0.4862592816352844,-0.22604097425937653,1.185446858406067,-0.4329546093940735,0.8084925413131714,-0.987469494342804,-0.5067744851112366,0.42375439405441284,-0.6006815433502197,-0.6381084322929382,0.21925407648086548,0.4646953344345093,-0.08624563366174698,0.2561306059360504,-0.3327593207359314,1.043115496635437,0.3592704236507416,-0.13491015136241913,-0.7212129831314087,0.13096672296524048,-0.45654943585395813,-0.5729213356971741,-0.14566758275032043,-0.06051729992032051,-0.0973675325512886,0.014948212541639805,0.6363939642906189,0.3438025116920471,-0.5323006510734558,-0.04201255738735199,-0.7629921436309814,0.6240261197090149,0.4816552996635437,0.7041102647781372,-0.6793649196624756